  return (
    <div className="dashboard">
      <aside className="sidebar">
        <h2>Categories</h2>
        <ul>
          {categories.map(category => (
            <li key={category.id}>{category.name}</li>
          ))}
        </ul>
      </aside>
      <main className="main-content">
        <h2>Announcements</h2>
        {announcements.map(announcement => (
          <article key={announcement.id}>
